import { TorusWalletAdapter } from './adapter';
export const TorusWalletName = 'Torus';
export const getTorusWallet = (config = {}) => ({
    name: TorusWalletName,
    url: 'https://tor.us',
    icon: 'data:image/svg+xml;base64,',
    adapter: new TorusWalletAdapter(config),
});
